let fieldName = $$.fieldNameEng;
                if((fieldName == 'dischargedFromWardAt' || fieldName == 'dischargedAt') && $[fieldName] != null){
                  let currentDate = new Date();
                  let dischargedFromWardAt = Date.parse($[fieldName]);
                  return ((currentDate - dischargedFromWardAt) / 86400 / 1000).toFixed(0);
                }else{
                  return $[$$.fieldNameEng];
                }
